  input: TEXT,F3XA,,"February 25, 2003    In response to your letter dated Jan. 22,
    2003, regarding missing employer and occupation information.  Pleased be advised
    that solicitations made by Democratic Majority 2003 include a clear and conspicuous
    notice stating that we are required to request and report the name, mailing address,
    occupation and employer for each individual whose contributions aggregate in excess
    of $200 in a calendar year.  All response cards or letters sent with soliciations
    include a space for donors to fill out this requested information and return it
    to us with their contribution.  If any contributor does not provide this information,
    we send them a follow-up letter within 30 days of receiving their contribution,
    again requesting this information and informing the donor that we are required
    to report this information.  This follow-up request is made without soliciting
    an additional contribution, and if the request is written, a pre-addressed stamped
    return envelope is included.  When we receive this information back from the donor,
    we include it as a memo entry on the next report.   As a joint fundraising committee
    formed by two existing committees solely for fundraising purposes, all administrative
    expenses incurred by the committee have been disclosed and identified as fundraising
    expenses.  All expenses incurred by the committee were direct costs of fundraising
    and therefore properly reported."
